import React, { Component } from 'react'

export default class Show extends Component {
  render() {
    return (
      <div>
        <h1>Catch 'Em!</h1>
        <h2>{pokemons.name.charAt(0).toUpperCase()}
        {pokemons.name.slice(1)}</h2>
        <img src={`${pokemons.img}.jpg`} />
        <a href="/pokemon">Back</a>
      </div>
    )
  }
}
